import React from 'react'
import {FormControl, FormGroup, Typography } from '@mui/material'
const LoginPage = () => {
  return (
    <FormGroup>
        <Typography variant="h4" align="center" gutterBottom> Login </Typography>

        <FormControl>
            <FormGroup></FormGroup>
        </FormControl>
        
    </FormGroup>
  )
}

export default LoginPage
